sources.sass/modules/components/footer.scss:
footer {
    padding: $section_padding;
    display: grid;
    grid-gap: 1.5em;
    grid-template-columns: 1fr 1fr 1fr 1fr;
    padding-left: 5em;
    padding-right: 5em;
    padding-bottom: 4em;

    .column {
        h1 {
            font-size: 1.1em;
            font-weight: bold;
            margin-bottom: 1em;
        }

        span {
            display: block;
            background: $color_green;
            width: 70px;
            height: 5px;
            margin-bottom: 1em;
        }

        ul {
            li a {
                display: inline-block;
                text-decoration: none;
                color: #000;
                p {
                    font-size: 0.9em;
                    font-weight: normal;
                    margin-bottom: 1em;
                }
            }
        }
    }
}

@media (max-width: 900px) {
    footer {
        padding-left: 2em;
        padding-right: 2em;
    }
}

@media (max-width: 750px) {
    footer {
        grid-template-columns: 1fr 1fr;
    }
}

@media (max-width: 480px) {
    footer {
        grid-template-columns: 1fr;
    }
}

sources.sass/modules/sections/neighborhoods.scss:
#neighborhoods {
    padding: $section_padding;

    .content {
        padding-top: 4em;
        display: grid;
        grid-template-columns: 1fr 1fr 1fr;
        grid-gap: 1.5em;
        grid-template-areas: 'berlin muenchen hamburg'
                             'hannover frankfurt frankfurt'
                             'dresden dresden koeln';

        .box {
            height: 250px;
            position: relative;
            background-position: center !important;
            background-size: cover !important;

            .label {
                z-index: 2;
                background: #fff;
                position: absolute;
                left: 0;
                bottom: 0;
                width: 12em;
                height: 4em;
                box-sizing: border-box;
                padding-left: 1em;
                display: flex;
                flex-direction: column;
                justify-content: center;
                p {
                    color: #000;
                    font-size: 1.3em;
                    font-weight: bold;
                }
            }
        }

        .berlin { grid-area: berlin; }
        .muenchen { grid-area: muenchen; }
        .hamburg { grid-area: hamburg; }
        .hannover { grid-area: hannover; }
        .frankfurt { grid-area: frankfurt; }
        .dresden { grid-area: dresden; }
        .koeln { grid-area: koeln; }

        .berlin { background: url('../images/berlin.jpg') no-repeat; }
        .muenchen { background: url('../images/muenchen.jpg') no-repeat; }
        .hamburg { background: url('../images/hamburg.jpg') no-repeat; }
        .hannover { background: url('../images/hannover.jpg') no-repeat; }
        .frankfurt { background: url('../images/frankfurt.jpg') no-repeat; }
        .dresden { background: url('../images/dresden.jpg') no-repeat; }
        .koeln { background: url('../images/koeln.jpg') no-repeat; }
    }
}

@media (max-width: 1030px) {
    #neighborhoods {
        .content {
            grid-template-columns: 1fr 1fr;
            grid-template-areas: 'berlin berlin'
                                 'muenchen hamburg'
                                 'hannover frankfurt'
                                 'dresden koeln';
        }
    }
}

@media (max-width: 600px) {
    #neighborhoods {
        .content {
            grid-template-columns: 1fr;
            grid-template-areas: 'berlin'
                                 'muenchen'
                                 'hamburg'
                                 'hannover'
                                 'frankfurt'
                                 'dresden'
                                 'koeln';
        }
    }
}

